import React, { useState } from "react";

function App() {
  let [amount, changeAmount] = useState();

  function Increment(){
    amount++;
    changeAmount;
  }

  function Dicrement(){
    amount--;
    changeAmount;
  }

  return (
    <div className="App">
      <h1>{amount}</h1>
      <button onClick={Increment}>Increment</button>
      <button onClick={Dicrement}>Dicrement</button>
    </div>
  );
}

export default App;
